    at the end of Sept and sent us their memo list and we included it with a note
    stating that the check would be deposited in October.     The Yard signs bumper
    stickers etc was paid for by contributions raised by the Democratic Party of Arkansas.   The
    last paragraph of page 4 refers to Voter Registration monies - The only thing
